package main

import "fmt"

func isAnagram(s string, t string) bool {
	words := make([]byte, 26)
	for _, w := range s {
		if w > 'z' || w < 'a' {
			continue
		}
		words[int(w-'a')]++
	}
	for _, w := range t {
		if w > 'z' || w < 'a' {
			continue
		}
		words[int(w-'a')]--
		if words[int(w-'a')] < 0 {
			return false
		}
	}
	for _, c := range words {
		if c != 0 {
			return false
		}
	}
	return true
}

